int cntNum(string X, int i, int sum, int tight, vector<vector<vi>> &dp)
{
    if(dp[sum][i][tight] != -1)
    {
        return dp[sum][i][tight];
    }

    if (i >= X.length() || sum < 0)
    {
        if (sum == 0)
        {
            return dp[sum][i][tight]  = 1;
        }
        return dp[sum][i][tight] = 0;
    }


    int res = 0;

    int end = tight != 0 ? X[i] - '0' : 9;

    for (int j = 0; j <= end; j++)
    {
        res += cntNum(X, i + 1, (sum - (j * j)),
                      (tight > 0 & (j == end)) ==
                              true
                          ? 1
                          : 0, dp);
    }
    return dp[sum][i][tight]  = res;
}

static int UtilCntNumRange(int L, int R, int Y, vector<vector<vi>> &dp)
{

    if (R == 0 && Y == 0)
    {
        return 1;
    }

    string str = to_string(R);

    int cntR = cntNum(str, 0, Y,
                      1, dp);


    str = to_string(L - 1);

    int cntL = cntNum(str, 0, Y,
                      1, dp);

    return (cntR - cntL);
}

