-- MOON RATING
--------------------------------------------------
-- I'm using this because it was the easier way
-- to simulate rating stars.
-------------------------------------------------- */

function moonRating(number) {
  
  // Is it a number?
  if (!isNaN(number)) {
    var votes;

    // Is it an interger?
    if (number % 1 === 0) {
      votes="🌕".repeat(number);
      votes+="🌑".repeat(5-number);
    
    // Or is it a float?
    } else {
      let n = Math.floor(number);
      votes="🌕".repeat(n);
      votes+="🌗";
      votes+="🌑".repeat(4-n);
    }
    return votes;
  } else {
    // If no votes
    return "------"
  }
}

