#include <iostream>
#include <vector>

using namespace std;

vector<int> p, dif, mn;
// p - массив ссылок
// dif[i] = x означает, что зарплата i-го человека больше зарплаты get_p(i) на x, get_p(i) - это номер человека, стоящего в корне множества, к которому принадлежит i-ый человек
// mn[i] = x, означает, что зарплата i-го человека должна быть >= x

int get_p(int v) { // get_p - принимает номер человека, а возвращает номер человека, стоящего в корне множества, к которому принадлежит i-ый человек
                   // get_p также сжимает пути и при сжатии путей обновляет значения в массиве dif
    if (v == p[v]) { // Если v-ый человек ссылается на самого себя, то он является корнем множества
        return p[v]; // Возвращаем корень множества
    }
    int pv = p[v]; // Запоминаем номер человека, на которого ссылается v-ый
    p[v] = get_p(p[v]); // Теперь p[v] - это номер человека в корне
    dif[v] += dif[pv]; // Обновляем разницу в зарплате между v-ый человеком и тем, что в корне
    return p[v]; // Возвращаем номер человека, находящегося в корне
}

void solve() {
    int n, m;
    cin >> n >> m; // Считываем кол-во людей и записей
    dif.resize(n); // Нам нужно знать разницу в зарплатах для каждого человека
    mn.resize(n); // Нам нужно знать минимальную допустимую зарплату потенциально для каждого человека (Потенциально, так как мы воспользуемся mn[i]-ым, только если i - это корень какого-то множества)
    p.resize(n); // Изначально каждое множество состоит из одного человека, поэтому он должен ссылаться на самого себя
    for (int i = 0; i < n; ++i) {
        p[i] = i;
    }
    for (int q = 0; q < m; ++q) { // Итерируемся по записям
        int i, j, d;
        cin >> i >> j >> d; // Считываем номер 1-го работника, номер 2-го работника, а также насколько зарплата 1-го больше зарплаты 2-го
        int pi = get_p(i); // pi - это номер человека в корне множества, к которому принадлежит i-ый человек
        int pj = get_p(j); // pj - это номер человека в корне множества, к которому принадлежит j-ый человек
        // Пусть i->j = x, означает, что зарплата i-го человека на x больше зарплаты j-го. Также i->j = -(j->i)
        if (pi == pj) { // Рассмотрим случай, когда i-ый и j-ый люди находятся в одном множестве
            // Так как i-ый и j-ый люди находятся в одном множестве, то мы можем вычислить насколько зарплата i-го больше зарплаты j-го
            // Имеем: i->j = i->pi + pi->j = i->pi + (-(j->pi)) = dif[i] + (-dif[j])
            if (dif[i] + (-dif[j]) != d) { // Проверяем, что разница d соответсвует разнице в зарплает
                cout << "Impossible after " << q + 1 << " statements"; // Если есть несоответсвие, то выводим специальный текст, означающий, что на (q + 1)-ой записи решение уже не удаётся найти
                return;
            }
        } else { // Рассмотрим случай, когда i-ый и j-ый люди находятся в разных множествах
            p[pi] = pj; // Зарплата i-го человека больше зарплаты j-го на d, следовательно i->j = d, следовательно нужно присоединить корень множества, к которому принадлежит i-ый человек, к корню множества, к которому принадлежит j-ый человек.
			// Так как pi - больше не корень, то нужно установить для него значение dif[pi]
            //   i->j = i->pi + pi->pj + pj->j
            //      d = i->pi + pi->pj + pj->j
            // pi->pj = d - i->pi - pj->j
            // pi->pj = d - i->pi + j->pj
            dif[pi] = d - dif[i] + dif[j];
        }
    }
    // Установим минимальные зарплаты для людей, которые находятся в корне какого-то множества
    for (int i = 0; i < n; ++i) {
        int pi = get_p(i); // pi - номер человека, находящегося в корне множества, к которому принадлжеит i-ый человек
        if (pi == 0) continue; // По условию, зарплата Василия не подлежит изменениям
        if (dif[i] < 0) { // dif[i] < 0 означает, что зарплата i-го человека меньше зарплаты pi-го на abs(dif[i]). Так как зарплата не может быть < 0, то зарплата pi-го человека должна быть хотя бы abs(dif[i])
            mn[pi] = max(mn[pi], abs(dif[i]));
        }
    }
    // Зарплата i-го человека - это минимальная зарплата человека в корне + то, насколко зарплаат i-го человека больше зарплаты человека в корне
    for (int i = 0; i < n; ++i) { // Итерируемся по людям
        int pi = get_p(i); // pi - это номер человека, находящегося в корне множества, к которому принадлкжит i-ый человек
        if (dif[i] + mn[pi] < 0 || dif[i] + mn[pi] > 1e9) { // Если зарплата i-го человека не удовлетворяет ограничениям, то у задачи нет решения.
            cout << "Impossible after " << m << " statements"; // Выводим, что только все вместе запросы всё испортили
            return;
        }
    }
    if (dif[0] + mn[get_p(0)] != 0) { // По условию, зарплата Василия равнаа 0, поэтому если это не выполянется, то решения нет
        cout << "Impossible after " << m << " statements"; // Выводим, что только все вместе запросы всё испортили
        return;
    }
    cout << "Possible\n"; // Выводим слово, обозначающее, что решение есть
    for (int i = 0; i < n; ++i) { // Итерируемся по людям
        cout << dif[i] + mn[get_p(i)] << '\n'; // Выводим зарплату i-го человека
    }
}

