    count = sum([x[0] for x in cards if x[0] < 10])         #NORMAL CARDS
    count += sum([10 for x in cards if 10 <= x[0] < 14])    #PICTURED CARDS
    count += sum([11 for x in cards if x[0] == 14])         #ACES
    return count

